<?php
session_start();

// Include the Joomla configuration file
if (file_exists('configuration.php')) {
    include_once 'configuration.php';
} else {
    die('Configuration file not found.');
}

// Get configuration variables from the JConfig class
if (class_exists('JConfig')) {
    $configClass = new JConfig();
    $config = [
        'host'     => $configClass->host,
        'user'     => $configClass->user,
        'password' => $configClass->password,
        'db'       => $configClass->db,
        'dbprefix' => $configClass->dbprefix,
        'fromname' => $configClass->fromname,
    ];
} else {
    die('JConfig class not found.');
}

// Generate CSRF token if not already set
if (empty($_SESSION['csrf_token'])) {
    $_SESSION['csrf_token'] = bin2hex(random_bytes(32));
}

$pageTitle = isset($config['fromname']) ? htmlspecialchars($config['fromname']) . ' :: Unsubscribe' : 'Unsubscribe';

// Handle the form submission (AJAX request)
if ($_SERVER['REQUEST_METHOD'] === 'POST') {
    // Set header to JSON
    header('Content-Type: application/json');

    // Check CSRF token
    if (!isset($_POST['csrf_token']) || $_POST['csrf_token'] !== $_SESSION['csrf_token']) {
        echo json_encode(['status' => 'error', 'message' => 'Invalid CSRF token.']);
        exit;
    }

    // Get and validate the email
    $email = isset($_POST['email']) ? trim($_POST['email']) : '';
    if (empty($email)) {
        echo json_encode(['status' => 'error', 'message' => 'No email provided.']);
        exit;
    }
    if (!filter_var($email, FILTER_VALIDATE_EMAIL)) {
        echo json_encode(['status' => 'error', 'message' => 'Invalid email address.']);
        exit;
    }

    // Establish a secure database connection using prepared statements
    $mysqli = new mysqli($config['host'], $config['user'], $config['password'], $config['db']);
    if ($mysqli->connect_error) {
        error_log('Database connection failed: ' . $mysqli->connect_error);
        echo json_encode(['status' => 'error', 'message' => 'An internal error occurred.']);
        exit;
    }

    $table = $config['dbprefix'] . 'easyblog_subscriptions';

    // Use prepared statements to prevent SQL injection
    $stmt = $mysqli->prepare("SELECT id FROM $table WHERE email = ?");
    $stmt->bind_param('s', $email);
    $stmt->execute();
    $result = $stmt->get_result();

    if ($result->num_rows > 0) {
        // Begin transaction
        $mysqli->begin_transaction();

        try {
            // Prepare delete statement
            $deleteStmt = $mysqli->prepare("DELETE FROM $table WHERE id = ? LIMIT 1");

            while ($row = $result->fetch_assoc()) {
                $id = $row['id'];
                $deleteStmt->bind_param('i', $id);

                if ($deleteStmt->execute()) {
                    // Log the deletion
                    error_log("SUBSCRIPTION_REMOVED_CUSTOMER_REQUEST for email: $email (ID: $id)");
                } else {
                    throw new Exception("Error deleting record with ID: $id");
                }
            }

            // Commit transaction
            $mysqli->commit();
            echo json_encode(['status' => 'success', 'message' => 'Email successfully removed from the mailing list.']);
        } catch (Exception $e) {
            // Roll back transaction and log error
            $mysqli->rollback();
            error_log($e->getMessage());
            echo json_encode(['status' => 'error', 'message' => 'An error occurred while removing the email.']);
        }

        // Close statements
        $deleteStmt->close();
    } else {
        echo json_encode(['status' => 'error', 'message' => 'No matching email found.']);
    }

    // Close connections
    $stmt->close();
    $mysqli->close();
    exit;
}
?>
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title><?php echo $pageTitle; ?></title>
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <!-- Include stylesheets and scripts -->
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/uikit@3.16.16/dist/css/uikit.min.css" />
    <script src="https://code.jquery.com/jquery-3.6.0.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/uikit@3.16.16/dist/js/uikit.min.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/uikit@3.16.16/dist/js/uikit-icons.min.js"></script>
</head>
<body>

<div class="uk-container uk-container-xsmall uk-margin-top">
    <div class="uk-grid-small uk-child-width-expand@s" uk-grid>
        <div>
            <h2 class="uk-margin-remove-bottom">Email Notifications</h2>
            <p>If you no longer wish to receive news updates from <?php echo htmlspecialchars($config['fromname']); ?>, simply enter your email below and we'll promptly remove you from the subscription list.</p>
            <form id="remove-email-form" class="uk-form-stacked">
                <div class="uk-margin">
                    <label class="uk-form-label" for="email">Email Address</label>
                    <div class="uk-form-controls">
                        <input class="uk-input" id="email" type="email" placeholder="Enter email address" required>
                    </div>
                </div>
                <!-- CSRF token -->
                <input type="hidden" name="csrf_token" value="<?php echo htmlspecialchars($_SESSION['csrf_token']); ?>">
                <button type="submit" class="uk-button uk-button-danger">Remove</button>
                <div id="response" class="uk-margin-top"></div>
            </form>
        </div>
        <div class="uk-text-right">
            <img src="data:image/png;base64," width="256" height="256" alt="Graphic">
        </div>
    </div>
</div>

<script>
    $(document).ready(function() {
        $('#remove-email-form').submit(function(e) {
            e.preventDefault();
            var email = $('#email').val();
            var csrf_token = $('input[name="csrf_token"]').val();

            $.ajax({
                url: '',
                method: 'POST',
                dataType: 'json',
                data: { email: email, csrf_token: csrf_token },
                success: function(response) {
                    var alertClass = response.status === 'success' ? 'uk-alert-success' : 'uk-alert-danger';
                    $('#response').html('<div class="' + alertClass + '" uk-alert><p>' + response.message + '</p></div>');
                },
                error: function() {
                    $('#response').html('<div class="uk-alert-danger" uk-alert><p>Error processing the request.</p></div>');
                }
            });
        });
    });
</script>

</body>
</html>
